import React, { Component } from 'react';
import { NavLink } from "react-router-dom";

class Navbar extends Component {

  render() {
    return (
      <div className="flex space-x-10 justify-center py-4">
        <NavLink className="bg-blue-200 px-3" activeClassName="bg-blue-500 px-3" to='/' exact>Home</NavLink>
        <NavLink className="bg-blue-200 px-3" activeClassName="bg-blue-500 px-3" to="/about">All Proposals</NavLink>
        <NavLink className="bg-blue-200 px-3" activeClassName="bg-blue-500 px-3" to="/edit">Edit Proposal</NavLink>
      </div>
    );
  }
  }

export default Navbar;
